import React, { useState, useEffect, useCallback } from 'react';
import {
  Container,
  Grid,
  Card,
  CardContent,
  Typography,
  TextField,
  Button,
  Box,
  CircularProgress,
  Alert,
  Chip,
  Stack,
} from '@mui/material';
import { Search, LocationOn, Business } from '@mui/icons-material';
import axios from 'axios';

const JobSearch = () => {
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [filters, setFilters] = useState({
    search: '',
    location: '',
    company: ''
  });

  const fetchJobs = useCallback(async () => {
    setLoading(true);
    try {
      const response = await axios.get('/api/jobs/', {
        params: {
          search: filters.search,
          location: filters.location,
          company: filters.company
        }
      });
      setJobs(response.data.results);
      setError(null);
    } catch (err) {
      setError('Failed to fetch jobs. Please try again later.');
      console.error('Error fetching jobs:', err);
    } finally {
      setLoading(false);
    }
  }, [filters]);

  useEffect(() => {
    fetchJobs();
  }, [fetchJobs]);

  const handleFilterChange = (event) => {
    const { name, value } = event.target;
    setFilters(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSearch = (event) => {
    event.preventDefault();
    fetchJobs();
  };

  const handleApply = async (jobId) => {
    try {
      await axios.post(`/api/jobs/${jobId}/apply/`);
      // Refresh job list to update application status
      fetchJobs();
    } catch (err) {
      setError('Failed to apply for the job. Please try again.');
      console.error('Error applying for job:', err);
    }
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

      {/* Search Filters */}
      <Card sx={{ mb: 3 }}>
        <CardContent>
          <form onSubmit={handleSearch}>
            <Grid container spacing={2}>
              <Grid item xs={12} md={4}>
                <TextField
                  fullWidth
                  name="search"
                  label="Keywords"
                  value={filters.search}
                  onChange={handleFilterChange}
                  InputProps={{
                    startAdornment: <Search sx={{ mr: 1, color: 'text.secondary' }} />
                  }}
                />
              </Grid>
              <Grid item xs={12} md={3}>
                <TextField
                  fullWidth
                  name="location"
                  label="Location"
                  value={filters.location}
                  onChange={handleFilterChange}
                  InputProps={{
                    startAdornment: <LocationOn sx={{ mr: 1, color: 'text.secondary' }} />
                  }}
                />
              </Grid>
              <Grid item xs={12} md={3}>
                <TextField
                  fullWidth
                  name="company"
                  label="Company"
                  value={filters.company}
                  onChange={handleFilterChange}
                  InputProps={{
                    startAdornment: <Business sx={{ mr: 1, color: 'text.secondary' }} />
                  }}
                />
              </Grid>
              <Grid item xs={12} md={2}>
                <Button
                  fullWidth
                  variant="contained"
                  type="submit"
                  sx={{ height: '100%' }}
                >
                  Search
                </Button>
              </Grid>
            </Grid>
          </form>
        </CardContent>
      </Card>

      {/* Job Listings */}
      {loading ? (
        <Box display="flex" justifyContent="center" my={4}>
          <CircularProgress />
        </Box>
      ) : (
        <Grid container spacing={3}>
          {jobs.map((job) => (
            <Grid item xs={12} key={job.id}>
              <Card>
                <CardContent>
                  <Typography variant="h5" gutterBottom>
                    {job.title}
                  </Typography>
                  <Stack direction="row" spacing={1} mb={2}>
                    <Chip icon={<Business />} label={job.company} />
                    <Chip icon={<LocationOn />} label={job.location} />
                    {job.skills?.map((skill) => (
                      <Chip key={skill} label={skill} variant="outlined" />
                    ))}
                  </Stack>
                  <Typography variant="body1" paragraph>
                    {job.description}
                  </Typography>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                    <Typography variant="body2" color="text.secondary">
                      Posted: {new Date(job.created_at).toLocaleDateString()}
                    </Typography>
                    <Button
                      variant="contained"
                      onClick={() => handleApply(job.id)}
                      disabled={job.has_applied}
                    >
                      {job.has_applied ? 'Applied' : 'Apply Now'}
                    </Button>
                  </Box>
                </CardContent>
              </Card>
            </Grid>
          ))}
          {jobs.length === 0 && !loading && (
            <Grid item xs={12}>
              <Alert severity="info">No jobs found matching your criteria.</Alert>
            </Grid>
          )}
        </Grid>
      )}
    </Container>
  );
};

export default JobSearch;
